import './styles.css'
type InputPropTypes={
    value:string;
    onChange :(e) => void;
    label :string;
    placeholder : string;
    type: 'text'|'password'

}
const Input :React.FC <InputPropTypes> = ({label,value,type,placeholder,onChange})=>{
return(
    <div>

        <input className='input'type={type} placeholder={placeholder} value={value} onChange={onChange}/>
        <label>{label}</label><br></br>

    </div>
)
}

export default Input;
